    "geo" : { },
    "id_str" : "1006625862391824386",
    "text" : "Ever wondered what's the fastest way to split a string by commas &amp; ignore whitespace?\n\nI used @jsperf to compare these two:\n\nA) str.trim().split(\/\\s*,\\s*\/);\nB) str.split(\",\").map(s =&gt; s.trim());\n\nResults: A is faster in Chrome, Safari, Edge. B in Firefox!\n\nhttps:\/\/t.co\/h4lyLewvoo",
